import React from 'react'
import { SVGProps } from 'react';

interface BaseIconProps extends Omit<SVGProps<SVGSVGElement>, 'viewBox'> {
    size?: number;
    className?: string;
}

export const createIcon = (
    viewBox: string,
    paths: React.ReactNode,
    displayName?: string
) => {
    const Icon = ({
        size = 24,
        className = '',
        ...props
    }: BaseIconProps) => {
        return (
            <svg
                width={size}
                height={size}
                viewBox={viewBox}
                fill="none"
                xmlns="http://www.w3.org/2000/svg"
                className={className}
                {...props}
            >
                {paths}
            </svg>
        );
    };

    Icon.displayName = displayName || 'Icon';
    return Icon;
};

